		return BasePeer::doValidate(DatoAcademicoPeer::DATABASE_NAME, DatoAcademicoPeer::TABLE_NAME, $columns);
	}

	/**
	 * Retrieve a single object by pkey.
	 *
	 * @param      int $pk the primary key.
	 * @param      PropelPDO $con the connection to use
	 * @return     DatoAcademico
	 */
	public static function retrieveByPK($pk, PropelPDO $con = null)
	{

		if (null !== ($obj = DatoAcademicoPeer::getInstanceFromPool((string) $pk))) {
			return $obj;
		}

		if ($con === null) {
			$con = Propel::getConnection(DatoAcademicoPeer::DATABASE_NAME, Propel::CONNECTION_READ);
		}

		$criteria = new Criteria(DatoAcademicoPeer::DATABASE_NAME);
		$criteria->add(DatoAcademicoPeer::ID, $pk);

		$v = DatoAcademicoPeer::doSelect($criteria, $con);

		return !empty($v) > 0 ? $v[0] : null;
	}

	/**
	 * Retrieve multiple objects by pkey.
	 *
	 * @param      array $pks List of primary keys
	 * @param      PropelPDO $con the connection to use
	 * @throws     PropelException Any exceptions caught during processing will be
	 *		 rethrown wrapped into a PropelException.
	 */
	public static function retrieveByPKs($pks, PropelPDO $con = null)
	{
		if ($con === null) {
			$con = Propel::getConnection(DatoAcademicoPeer::DATABASE_NAME, Propel::CONNECTION_READ);
		}

		$objs = null;
		if (empty($pks)) {
			$objs = array();
		} else {
			$criteria = new Criteria(DatoAcademicoPeer::DATABASE_NAME);
			$criteria->add(DatoAcademicoPeer::ID, $pks, Criteria::IN);
			$objs = DatoAcademicoPeer::doSelect($criteria, $con);
		}
		return $objs;
	}

